import React, { useState } from "react";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import { Button } from "react-bootstrap";
import Styles from "./NavList.module.css";

export default function NavList(props) {
	const { test } = props;
	const { selectedIndex, setSelectedIndex } = test;

	return (
		<div className={Styles.container}>
			<List>
				<ListItem>
					<Button onClick={() => setSelectedIndex(0)}>Home</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setSelectedIndex(1)}>Profile</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setSelectedIndex(2)}>Notifications</Button>
				</ListItem>
				<ListItem>
					<Button onClick={() => setSelectedIndex(1)}>Messages</Button>
				</ListItem>
				<ListItem>
					<Button>Bookmarks</Button>
				</ListItem>
				<ListItem>
					<Button>More</Button>
				</ListItem>
				<ListItem>
					<Button>Quote</Button>
				</ListItem>
			</List>
		</div>
	);
}
